var Api = {
    getDate(query, token){
        var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/events/date?date='+query;
        return fetch(url, {
            method: 'GET',
            headers: {
                authorizationToken: token
            },
        })
            .then((res) => res.json());
    },

    login(Email, Password){
        var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/login';
        return fetch(url, {
          method: 'POST',
          body: JSON.stringify({
            email: Email,
            password: Password,
          })
        })
        .then((res) => res.json());
    },

    sendEmail(Email){
        var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/code/send'
        return fetch(url, {
              method: 'POST',
              body: JSON.stringify({
                email: Email,
              })
            })
            .then((res) => res.json());
    },

    register(Code, Email, Password, Name){
        var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/user'
        return fetch(url, {
              method: 'POST',
              body: JSON.stringify({
                code: Code,
                email: Email,
                password: Password,
                name: Name,
                description: "I like working out!",
                image: "data:image/png;base64,"
              })
            })
            .then((res) => res.json());
    },

    resendEmail(Email){
        var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/code/resend'
        return fetch(url, {
              method: 'POST',
              body: JSON.stringify({
                email: Email,
              })
            })
            .then((res) => res.json());
    },

    verifyEmail(Email, Code){
        var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/code/verify'
        return fetch(url, {
              method: 'POST',
              body: JSON.stringify({
                email: Email,
                code: Code
              })
            })
            .then((res) => res.json());
    },

    getUser(query, token){
        var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/user/?id='+query;
        return fetch(url, {
                    method: 'GET',
                    headers: {
                        authorizationToken: token
                    },
                })
                    .then((res) => res.json());
    },

    updateUser(token, password, name, description){
        var body = {
          image: "data:image/png;base64,"
        };

        if(password) {
          body.password = password;
        }

        if(name) {
          body.name = name;
        }

        if(description) {
          body.description = description;
        }

        var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/user';
        return fetch(url, {
             method: 'PUT',
              headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
                authorizationToken: token,
              },
              body: JSON.stringify(body),
        }).then((res) => res.json())
    },

    markEvent(query, token){
       var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/marks?eventId='+query
       return fetch(url, {
             method: 'POST',
             headers: {
                 'Accept': 'application/json',
                 'Content-Type': 'application/json',
                 authorizationToken: token,
               },
           })
           .then((res) => res.json());
   },

   unmarkEvent(query, token){
      var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/marks?eventId='+query
      return fetch(url, {
            method: 'DELETE',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
                authorizationToken: token,
              },
          })
          .then((res) => res.json());
  },

   getMarks(token){
       var url = 'https://1fgs4l61r4.execute-api.us-east-1.amazonaws.com/Sprint2/marks'
       return fetch(url, {
           method: 'GET',
           headers: {
               authorizationToken: token
           },
       })
           .then((res) => res.json());
   },


};

module.exports = Api;
